MCO_RET      Dimensions_fixed_get             ( Dimensions *handle_, Dimensions_fixed* dst_ )
{ MCO_RET rc_ = MCO_S_OK, has_nulls_ = MCO_S_OK;
  return
    (rc_ = Dimensions_width_get(handle_, &dst_->width)) == MCO_S_OK &&
    (rc_ = Dimensions_length_get(handle_, &dst_->length)) == MCO_S_OK &&
    (rc_ = Dimensions_height_get(handle_, &dst_->height)) == MCO_S_OK
  ? has_nulls_ : rc_;
}

