MCO_RET      Part_fixed_get                     ( Part *handle_, Part_fixed* dst_ )
{ MCO_RET rc_ = MCO_S_OK, has_nulls_ = MCO_S_OK;
  Dimensions dim;
  return
    (rc_ = Part_price_get(handle_, &dst_->price)) == MCO_S_OK &&
    (rc_ = Part_code_get(handle_, &dst_->code)) == MCO_S_OK &&
    (rc_ = Part_dim_read_handle(handle_, &dim)) == MCO_S_OK && ((rc_ = Dimensions_fixed_get(&dim, &dst_->dim)) == MCO_S_OK || (has_nulls_ = rc_) == MCO_S_NULL_VALUE) &&
    (rc_ = Part_options_get_range(handle_, 0, 10, dst_->options)) == MCO_S_OK
  ? has_nulls_ : rc_;
}

MCO_RET      Part_fixed_put                     ( Part *handle_, Part_fixed const* src_ )
{ MCO_RET rc_;
  Dimensions dim;
  return
    (rc_ = Part_price_put(handle_, src_->price)) == MCO_S_OK &&
    (rc_ = Part_code_put(handle_, src_->code)) == MCO_S_OK &&
    (rc_ = Part_dim_write_handle(handle_, &dim)) == MCO_S_OK && (rc_ = Dimensions_fixed_put(&dim, &src_->dim)) == MCO_S_OK &&
    (rc_ = Part_options_put_range(handle_, 0, 10, src_->options)) == MCO_S_OK
  ? MCO_S_OK : rc_;
}

